START TRANSACTION;
--
-- Create game sessions
--
SET FOREIGN_KEY_CHECKS=0;

TRUNCATE game_types;


TRUNCATE game_sessions;

UPDATE game_sessions 
	SET fk_player_1 = FLOOR(1 + 250 * RAND())
WHERE 1 = 1;

UPDATE game_sessions 
	SET fk_player_2 = FLOOR(1 + 250 * RAND())
WHERE 1 = 1;

UPDATE game_sessions 
	SET fk_game_type = FLOOR(1 + 13 * RAND())
WHERE 1 = 1;

UPDATE game_sessions 
	SET p1_score = FLOOR(0 + 4 * RAND())
WHERE 1 = 1;

UPDATE game_sessions 
	SET p2_score = FLOOR(0 + 3 * RAND())
WHERE 1 = 1;

SET FOREIGN_KEY_CHECKS=1;
COMMIT;